import React from "react";

export default function Recommended() {
  return (
    <>
     

      <div classNameName=" bg-gray h-80  flex justify-center ">
        <div classNameName="mt-10 ">
          <div classNameName="mt-10 mb-10">
            <p classNameName="">
              Trusted By Over <span>13,400</span> Students & Organisation
              <br />
              Recommended Around The World
            </p>
          </div>{" "}
          <div classNameName=" flex justify-center bg-gray-200 my-2">
            {" "}
            <div classNameName="ml-10 grayscale hover:grayscale-0 ">
              {" "}
              <img src="https://www.radiustheme.com/demo/wordpress/themes/quiklearn/wp-content/uploads/2023/08/brand-img14.svg"></img>{" "}
            </div>
            <div classNameName="ml-10 grayscale hover:grayscale-0">
              {" "}
              <img src="https://www.radiustheme.com/demo/wordpress/themes/quiklearn/wp-content/uploads/2023/08/brand-img13.svg"></img>{" "}
            </div>
            <div classNameName="ml-10 grayscale hover:grayscale-0">
              {" "}
              <img src="https://www.radiustheme.com/demo/wordpress/themes/quiklearn/wp-content/uploads/2023/08/brand-img15.svg"></img>{" "}
            </div>
            <div classNameName="ml-10 grayscale hover:grayscale-0">
              {" "}
              <img src="https://www.radiustheme.com/demo/wordpress/themes/quiklearn/wp-content/uploads/2023/08/brand-img16.svg"></img>{" "}
            </div>
            <div classNameName="ml-10 grayscale hover:grayscale-0">
              {" "}
              <img src="https://www.radiustheme.com/demo/wordpress/themes/quiklearn/wp-content/uploads/2023/08/brand-img17.svg"></img>{" "}
            </div>
            <div classNameName="ml-10 grayscale hover:grayscale-0">
              {" "}
              <img src="https://www.radiustheme.com/demo/wordpress/themes/quiklearn/wp-content/uploads/2023/08/brand-img18.svg"></img>{" "}
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
